# Treating Duplicates:
class ProcessDuplicates:

    def __init__(self, df):
        self.df = df

    def detect_duplicates(self, features):
        duplicated_values = []
        column_values = []
        for feature in features:
            column_values.append(feature)
            duplicated_values.append(self.df[feature].duplicated().any())
        if_duplicated_df = pd.DataFrame({"Column Names" : column_values, "Is_Duplicated" : duplicated_values})
        return if_duplicated_df
    def percentage_duplicates(self, features):
        percentage_values = []
        column_values = []
        for feature in features:
            column_values.append(feature)
            percentage_values.append(self.df[feature].duplicated().mean()*100)
        perc_duplicated_df = pd.DataFrame({"Column Names" : column_values, "Percentage of Duplicates" : percentage_values})
        return perc_duplicated_df

    def plot_duplicates(self, features, vertical = True):
        duplicated_df = self.percentage_duplicates(features)
        if vertical == True:
            plot = sns.barplot(x = "Column Names", y = "Percentage of Duplicates", data = duplicated_df)
        else:
            plot = sns.barplot(x = "Percentage of Duplicates", y = "Column Names", data = duplicated_df)
        return plot

    def remove_duplicates(self, features):
        for feature in features:
            self.df.drop_duplicates(subset = [feature], inplace = True)
        return self.df

