# Treating Nulls:
class ProcessNulls:

    def __init__(self, df):
        self.df = df

    def detect_nulls(self, features):
        if_null_values = []
        column_names = []
        for feature in features:
            if_null_values.append(self.df[feature].isnull().any())
            column_names.append(feature)
        if_null_df = pd.DataFrame({"Column_Names" : column_names, "If_Null" : if_null_values})
        return if_null_df

    def percentage_nulls(self, features):
        perc_null_values = []
        column_names = []
        for feature in features:
            column_names.append(feature)
            perc_null_values.append(self.df[feature].isnull().mean() * 100)
        perc_null_df = pd.DataFrame({"Column Names" : column_names, "Percentage of Nulls" : perc_null_values})
        return perc_null_df

    def plot_nulls(self, features, vertical = True):
        perc_null_df = self.percentage_nulls(features)
        if vertical == True:
            plot = sns.barplot(x = "Column Names", y = "Percentage of Nulls", data = perc_null_df)
        else:
            plot = sns.barplot(x = "Percentage of Nulls", y = "Column Names", data = perc_null_df)
        return plot

    def impute_nulls(self, features, method = "drop", value = None):
        for feature in features:
            if method == "drop":
                self.df.dropna(subset = feature, inplace = True)
            elif method == "mean":
                self.df[feature].fillna(self.df[feature].mean(), inplace = True)
            elif method == "median":
                self.df[feature].fillna(self.df[feature].median(), inplace = True)
            elif method == "mode":
                self.df[feature].fillna(self.df[feature].mode()[0], inplace = True)
            elif method == "custom" and value is not None:
                self.df[feature].fillna(value, inplace = True)
        return self.df

