Data.head()

class ValueCountEncoding:
    def __init__(self, df):
        self.df = df

    def value_encoding(self, features):
        for feature in features:
            feature_count = self.df[feature].value_counts()
            feature_dict = feature_count.to_dict()
            self.df[str(feature) + "_encoded"] = self.df[feature].map(feature_dict)
        return self.df

